import React from 'react';

export default function Graph({graphSeg}) {
    function createGraph() {
        let amount = graphSeg.started + graphSeg.finish + graphSeg.complete
        let startPerc = (graphSeg.started / amount) * 100
        let finishPerc = (graphSeg.finish / amount) * 100
        let completePerc = (graphSeg.complete / amount) * 100
        
        console.log(graphSeg, amount, startPerc, finishPerc, completePerc);


        return {background: `linear-gradient(to right, rgba(34,193,195,1) ${startPerc}%, rgba(171,215,77,1) ${finishPerc}%, rgba(171,215,77,1) ${finishPerc}% ,rgba(253,187,45,1) ${completePerc}%)`}
    }

    // createGraph()

    return(
        <div className='graph-cont'>
            <div 
            className="graph"
            style={createGraph()}
            ></div>
        </div>
    )
}
